SET @ATTR_DATA = '<Item><F_1015700>DVCMTC3</F_1015700><F_1015710>Bright and fruity, crisp apples and warm caramel.</F_1015710><F_1015896>CA</F_1015896><F_1015895>Canadian Club infuses its signature blended 1858 Canadian whisky with a bright, fruity, apple liqueur that&amp;apos;s delightful on the tongue|Softly amber in color, Canadian Club Apple hits the nose with fresh, crisp apple aromas and brings a warm caramel taste that finishes light and smooth|Great for sipping on its own, Canadian Club Apple is also ideal for mixing simply with ginger ale or club soda|Create an apple old fashioned by muddling sugar, a splash of water, several dashes of bitters, a slice of orange, and a cherry in a glass, then fill with ice and Canadian Club Apple|For more than 150 years, Canadian Club whisky has been known worldwide as smooth, versatile and easy to enjoy</F_1015895><F_1015703>42</F_1015703><F_1016615>New</F_1016615><F_1015702>21</F_1015702><F_1015701>1071</F_1015701><F_1015894>Canadian Whiskey|Canadian Whisky|Whiskey|Whisky|Apple flavored whiskey|Canadian Whiskey cocktails</F_1015894><F_1015893>Smooth and crisp, Canadian Club Apple Whisky infuses its signature blended 1858 Canadian whisky with a bright, fruity, apple liqueur that&amp;apos;s softly amber in color and delightful on the tongue. Hitting the nose with fresh, crisp apple aromas, the taste combines hints of caramel with warm bakery notes and finishes light and smooth. Great for sipping on its own, Canadian Club Apple is also ideal for mixing simply with ginger ale or club soda. Concoct an apple old fashioned by muddling one teaspoon of sugar, a splash of water, several dashes of bitters, a slice of orange, and a Maraschino cherry. Remove the orange rind and fill the glass with ice and Canadian Club Apple Whisky.</F_1015893><F_999>000</F_999></Item>';
