SET @ATTR_DATA = '<Item><F_1015893_de>Eine elegante und seltene Mischung aus Eaux-de-Vie auf dem Höhepunkt des Geschmacks. Perfekt vermählen sich die Grande Champagne und Borderies Crus, beginnend im zarten Alter von 30 und reift bis zu und über 50 Jahre. &amp;quot;Der Initiale Extra kombiniert Aromen, die eines wirklich großartigen Cognacs würdig sind, und harmoniert alten Portwein mit Trüffeln und heißem Obstkuchen. Nur ein paar Tropfen reichen aus, um eine Explosion auszulösen, die für immer am Gaumen zu verweilen scheint.&amp;quot;&#x0D;
</F_1015893_de><F_1015700>FEANNA5</F_1015700><F_1015896>FR</F_1015896><F_1015703>80</F_1015703><F_1015701>1077</F_1015701><F_1015893>An elegant and rare blend of eaux-de-vie at the peak of flavour. Perfectly marrying the Grande Champagne and Borderies crus, starting at the delicate age of 30 and maturing up to and beyond 50 years old. “Combining flavours worthy of a truly great cognac, Initiale Extra harmonizes old port wine with truffle and hot fruitcake. Only a few drops are enough to induce an explosion that seems to linger on the palate forever.”</F_1015893><F_1016615>New</F_1016615><F_1015702>40.00</F_1015702><F_999>000</F_999></Item>';
