SET @ATTR_DATA = '<Item><F_1015700>FEAOBA5</F_1015700><F_1015710>Fine, light, distinctive</F_1015710><F_1015896>FR</F_1015896><F_1015895>Versatile, multi-layered and sophisticated|Delicate marriage of four cru Cognacs for balanced taste|Flavors of mature summer stone fruits, jasmine and gingerbread|Presented in a statement bottlem ideal for gifting|Made in Jarnac, France</F_1015895><F_1015703>80</F_1015703><F_1015701>1081</F_1015701><F_1015894_pt>conhaque|francês|courvoisier|cerveja|vodka|gin</F_1015894_pt><F_1015893_pt>Descubra a versatilidade da nossa mistura de Maison com Courvoisier VSOP. Cada gole é evocativo de um longo dia de verão, com aromas florais de jasmim, rosa e pêssegos secos sustentados pelo tempero vivo do pão de gengibre. Suficientemente complexo para beber puro, também pode elevar os coquetéis clássicos como o French Twist. Um casamento impecável de quatro crus, este conhaque exuberantemente floral expressa a arte sutil da mistura. Experimente a vida enquanto cada copo revela a herança e a riqueza de Jarnac; o lugar especial que nos orgulhamos de chamar de lar.</F_1015893_pt><F_1015894>Courvoisier VSOP|VSOP Cognac|Courvoisier VSOP Cognac|Courvosier Cognac|Cognac|Top shelf Cognac|80 Proof|40% ABV|Courvoisier</F_1015894><F_1015893>Discover the multi-layered versatility of our Maison blend with Courvoisier VSOP. Each sip is redolent of a long summer&amp;apos;s day, with floral aromas of jasmine, rose and dried peaches underpinned by the lively spice of gingerbread. Complex enough to drink neat, it can also elevate classic cocktails such as the French Twist. An impeccable marriage of four crus, this exuberantly floral Cognac expresses the subtle art of blending. Experience joie de vivre as each glass reveals the heritage and riches of Jarnac; the special place we are proud to call home.</F_1015893><F_1015895_pt>Versátil, multicamada e sofisticado|Casamento delicado de quatro conhaques crus para um sabor equilibrado|Sabor de frutas maduras do verão, jasmim e pão de gengibre|Apresentado em uma garrafa ideal para presente|Fabricado em Jarnac, França</F_1015895_pt><F_1015702>40.00</F_1015702><F_1016615>New</F_1016615><F_999>000</F_999></Item>';
