,ATTR_DATA = '<Item><F_1015700>FEAOEA5</F_1015700><F_1015710>Velvety, exotic</F_1015710><F_1015896>FR</F_1015896><F_1015895>Embodiment of the House of Courvoisier’s opulence|Crafted from carefully selected eaux-de-vie|Rich, complex bouquet of creme brulee, candied orange and iris flower|Presented in a statement teardrop bottle, ideal for gifting|Made in Jarnac, France</F_1015895><F_1015703>80</F_1015703><F_1015701>1316</F_1015701><F_1015894_pt>conhaque|francês|courvoisier|cerveja|vodka|gin</F_1015894_pt><F_1015893_pt>Descubra a opulência da Maison Courvoisier com nosso XO Cognac. Delicado, rico e complexo, oferece aromas outonais de crème brûlée, casca de laranja cristalizada e flor de íris. O final longo e prolongado deixa um elegante sabor floral no paladar. Uma das mais finas misturas de conhaque, é melhor degustado puro ou com uma gota de água para realçar seus aromas sutis. Cada garrafa expressa o terroir único de Jarnac, o lugar que chamamos de lar, e é elaborado a partir de aguardentes cuidadosamente selecionadas. Intrincado e exuberante, é uma expressão vibrante de nosso conhaque em flor.</F_1015893_pt><F_1015894>Courvoisier XO|XO Cognac|Courvoisier XO Cognac|Courvosier Cognac|Cognac|Top shelf Cognac|80 Proof|40% ABV|Courvoisier</F_1015894><F_1015893>Discover the opulence of Maison Courvoisier with our XO Cognac. Delicate, rich and complex, it offers autumnal aromas of crème brûlée, candied orange peel and iris flower. The long, lingering finish leaves an elegant floral flavor on the palate. One of the finest Cognac blends, it&amp;apos;s best sipped neat or with a drop of water to enhance its subtle aromas. Each bottle expresses the unique terroir of Jarnac, the place we call home,  and is crafted from carefully selected eaux-de-vie. Intricate and exuberant, it’s a vibrant expression of our Cognac in blossom.</F_1015893><F_1015895_pt>Encarnação da opulência da House of Courvoisier|Criado a partir de aguardente cuidadosamente selecionada|Bouquet rico, complexo de crème brûlée, laranja cristalizada e flor de íris|Apresentado em uma garrafa em forma de lágrima, ideal para presentear|Fabricado em Jarnac, França</F_1015895_pt><F_1015702>40.00</F_1015702><F_1016615>New</F_1016615><F_999>000</F_999></Item>'
