SET @ATTR_DATA = '<Item><F_1015700>FELECBR</F_1015700><F_1015710>Licorice, dried plum and apricot – full-bodied and rich, building to a smouldering intensity guaranteed to linger on the palate.</F_1015710><F_1015896>FR</F_1015896><F_1015895>L’Essence is the embodiment of Courvoisier itself: Tradition, Craftsmanship, Passion and Innovation|Precious and unique, L’Essence de Courvoisier is the most original cognac of its generation|An exquisite blend with over 100 precious ‘eaux de vie’ from the two most exclusive crus in the Cognac region; Grande Champagne and Borderies|The Baccarat decanter is individually numbered and hand crafted|The ornate crystal stopper is inspired by Napoleon’s initial ring, which he bestowed upon commanders in his army in commemoration of noble acts|Courvoisier is at the forefront of cognac innovation, continually creating new, award-winning blends and product variations that move the category forward</F_1015895><F_1015703>84</F_1015703><F_1016615>New</F_1016615><F_1015702>42</F_1015702><F_1015701>1088</F_1015701><F_1015894>Courvoisier|Cognac|Courvoisier Cognac|Top shelf Cognac|L&amp;apos;Essence|L&amp;apos;Essence Cognac|L&amp;apos;Essence de Courvoisier</F_1015894><F_1015893>From the House of Courvoisier comes a transcendental spirit, one that harkens the past to be enjoyed in the present. Special reserves from the early 20th century offer depth and harmony and are complemented by eaux-de-vie from the later 20th century breathing life into the spirit. L’Essence de Courvoisier® blends over 100 rare eaux-de-vie from Grande Champagne and Borderies, the most exclusive crus in the Cognac region. Courvoisier lends immediate clout to any shelf or backbar as the only cognac house to have received France’s highest award, the Prestige de la France, the highest honor for any French wine or spirit.</F_1015893><F_1015893_de>Aus dem Haus Courvoisier kommt ein fast überirdischer Geist, der die Vergangenheit in der Gegenwart genießen lässt. Besondere Lagerungen aus dem frühen 20. Jahrhundert bieten Tiefe und Harmonie und werden ergänzt durch Eaux-de-Vie aus dem späten 20. Jahrhundert, die der Spirituose Leben einhauchen. L''Essence de Courvoisier® mischt über 100 seltene Eaux-de-Vie aus Grande Champagne und Borderies, den exklusivsten Crus in der Region Cognac. Als das einzige Cognac-Haus, das Frankreichs höchste Auszeichnung – den Prestige de la France – erhalten hat, verleiht Courvoisier jedem Regal und jeder Backbar sofort Bedeutung.&#x0D;
</F_1015893_de><F_999>000</F_999></Item>';
