 aus dem frühen 20. Jahrhundert bieten Tiefe und Harmonie und werden ergänzt durch Eaux-de-Vie aus dem späten 20. Jahrhundert, die der Spirituose Leben einhauchen. L''Essence de Courvoisier® mischt über 100 seltene Eaux-de-Vie aus Grande Champagne und Borderies, den exklusivsten Crus in der Region Cognac. Als das einzige Cognac-Haus, das Frankreichs höchste Auszeichnung – den Prestige de la France – erhalten hat, verleiht Courvoisier jedem Regal und jeder Backbar sofort Bedeutung.&#x0D;
