SET @ATTR_DATA = '<Item><F_1015700>FFCVDBQ</F_1015700><F_1015710>Vine ripe cucumber</F_1015710><F_1015896>NL</F_1015896><F_1015895>EFFEN® Vodka is a super-premium vodka whose name means smooth, even and balanced in Dutch|EFFEN® starts with a foundation of 100% premium wheat from Northern France – a pure starch that leads to a silky smooth liquid |EFFEN® is distilled continuously at temps below 85˚, creating vodka with no traces of burnt sugar|EFFEN® is cut with pure spring water that has been purified through reverse osmosis, a process that creates technically perfect water|With the essence of freshly harvested vine-ripe cucumbers, this flavored vodka creates a refreshing take on classic cocktails	|Made from premium French wheat, EFFEN® Vodka uses a continuous distillation process, along with natural ingredients to create a smooth taste on the palate|It pairs well with melons such as cantaloupe or watermelon, can provide a crisp twist to a traditional martini and also mixes well with soda water, tonic or lemon-lime soda to create a cool, refreshing cocktail</F_1015895><F_1015703>75</F_1015703><F_1015702>37.5</F_1015702><F_1016615>New</F_1016615><F_1015701>1098</F_1015701><F_1015894>EFFEN Cucumber Vodka|EFFEN|Cucumber Vodka|Flavored Vodka|Wheat Vodka|Dutch Vodka|effen 50 cent|50 Cent Vodka|Super Premium Vodka|effen vodka fifty cent</F_1015894><F_1015893>Known for its innovative flavor choices, EFFEN Vodka is ahead of the curve once again with EFFEN Cucumber Vodka. With the essence of freshly harvested vine-ripe cucumbers, this flavored vodka creates a refreshing take on classic cocktails. Made from premium French wheat, EFFEN Vodka uses a continuous distillation process, along with natural ingredients to create a smooth taste on the palate. It pairs well with melons such as cantaloupe or watermelon, can provide a crisp twist to a traditional martini and also mixes well with soda water, tonic or lemon-lime soda to create a cool, refreshing cocktail.</F_1015893><F_999>000</F_999></Item>';
