SET @ATTR_DATA = '<Item><F_1015700>FFYUZBQ</F_1015700><F_1015710>Slight sweetness with herbal and fruity tones balanced with grapefruit zest</F_1015710><F_1015896>NL</F_1015896><F_1015895>Clear color|Bright citrus with floral back notes|Slight sweetness with herbal and fruity tones balanced with grapefruit zest|Finish is a touch of sweet citrus</F_1015895><F_1015703>75</F_1015703><F_1016615>New</F_1016615><F_1015702>37.5</F_1015702><F_1015701>1115</F_1015701><F_1015893>EFFEN Vodka starts with a foundation of 100% premium wheat from Northern France – a pure starch that leads to a silky smooth liquid. Then it is distilled continuously at temperatures below 85 degrees, creating a vodka with no traces of burnt sugar. After that, it’s filtered through a column of active carbon to deliver optimal filtration. Finally, it’s blended with pure spring water that has been purified through reverse osmosis, a process that creates technically perfect water, producing a clean, smooth vodka.

