SET @ATTR_DATA = '<Item><F_1015700>FOBAPBO</F_1015700><F_1015896>US</F_1015896><F_1015895>Made with premium apricot distillate blended with crushed fruit kernels and quality brandy, this fine apricot brandy smacks of summer|Considered an aphrodisiac in Europe for centuries, the apricot&amp;apos;s luscious curves, juicy flesh, and sweet taste led people to believe that eating dried apricots or prunes unleashed the powers of love|Perfect sipping on its own, its fruity flavor shines through in an Apricot Caipirinha, or mingled with fresh lime and orange juice and soda for a refreshing Apricot Fizz|DeKuyper has been the brand bartenders trust to add color, flavor and fun to any cocktail</F_1015895><F_1015703>60</F_1015703><F_1016615>New</F_1016615><F_1015702>30</F_1015702><F_1015701>1119</F_1015701><F_1015893>Versatile with a quintessential apricot taste, DeKuyper Apricot Flavored Brandy is essential for classic and modern cocktails. Made with premium apricot distillate blended with crushed fruit kernels and quality brandy, this fine apricot brandy is the essence of summer. Considered an aphrodisiac in Europe for centuries, the apricot&amp;apos;s luscious curves, juicy flesh and sweet taste led people to believe that eating dried apricots or prunes unleashed the powers of love. Perfect sipping on its own, its fruity flavor shines through in an Apricot Caipirinha, or mingled with fresh lime and orange juice and soda for a refreshing Apricot Fizz. With a heritage dating back more than 300 years, DeKuyper Cordials &amp;amp; Liqueurs continues to be on the cutting edge of the spirits industry. DeKuyper&amp;apos;s evolution has been successful through the combination of its rich, traditional expertise and modern innovation, creating mixable and versatile cordials, liqueurs, crèmes, brandies and schnapps made from the world&amp;apos;s finest ingredients. DeKuyper has been the brand bartenders trust to add color, flavor and fun to any cocktail.</F_1015893><F_999>000</F_999></Item>';
