SET @ATTR_DATA = '<Item><F_1015700>FOCMGBO</F_1015700><F_1015710>Cool and refreshing</F_1015710><F_1015896>US</F_1015896><F_1015895>Mint leaves make this liqueur, and cocktails made with it, undeniably smooth and rich with a cool refreshing taste|Add it to your favorite cocktails instead of mint leaves for an extra boost of invigorating mint flavor|DeKuyper has been the brand bartenders trust to add color, flavor and fun to any cocktail</F_1015895><F_1015703>60</F_1015703><F_1016615>New</F_1016615><F_1015702>30</F_1015702><F_1015701>1142</F_1015701><F_1015894>DeKuyper Creme de Menthe|DeKuyper|DeKuyper Green|DeKuyper Creme de Menthe Green| DeKuyper Mint|DeKuyper Green Mint</F_1015894><F_1015893>DeKuyper Creme de Menthe features a vibrant green color and a cool, refreshing mint taste that&amp;apos;s key to making the classic Grasshopper. Add it to your favorite cocktails instead of mint leaves for an extra boost of invigorating mint flavor. For a perfect Grasshopper cocktail, mix one part DeKuyper Creme de Menthe with one part Crème de Cacao and one part heavy cream over rocks for a delightfully refreshing mix of mint and creamy chocolate.</F_1015893><F_999>000</F_999></Item>';
