SET @ATTR_DATA = '<Item><F_1015700>FOCMWBO</F_1015700><F_1015896>US</F_1015896><F_1015895>Mint leaves make this liqueur, and cocktails made with it, undeniably smooth and rich, with a cool refreshing taste|Add it to your favorite cocktails instead of mint leaves for an extra boost of invigorating mint flavor|Blend it in an ice-filled shaker with vodka and pour into a martini glass for a bracing Victory Vodka Stinger |Add the same ingredients with Blue Curacao and half and half for a DeKuyper Mintini|DeKuyper has been the brand bartenders trust to add color, flavor and fun to any cocktail</F_1015895><F_1015703>60</F_1015703><F_1016615>New</F_1016615><F_1015702>30</F_1015702><F_1015701>1144</F_1015701><F_1015893>Energize your cocktails with DeKuyper Crème de Menthe White. Mint leaves make this liqueur and cocktails made with it, undeniably smooth and rich, with a cool refreshing taste. Add it to your favorite cocktails instead of mint leaves for an extra boost of invigorating mint flavor. Blend it in an ice-filled shaker with vodka and pour into a martini glass for a bracing Victory Vodka Stinger. Add the same ingredients with Blue Curacao and half and half for a DeKuyper Mintini. With a heritage dating back more than 300 years, DeKuyper Cordials &amp;amp; Liqueurs continues to be on the cutting edge of the spirits industry. DeKuyper&amp;apos;s evolution has been successful through the combination of its rich, traditional expertise and modern innovation, creating mixable and versatile cordials, liqueurs, crèmes, brandies and schnapps made from the world&amp;apos;s finest ingredients. DeKuyper has been the brand bartenders trust to add color, flavor and fun to any cocktail.</F_1015893><F_999>000</F_999></Item>';
