SET @ATTR_DATA = '<Item><F_1015700>FODANBO</F_1015700><F_1015896>US</F_1015896><F_1015895>Distilled with imported aniseed and blended with fine neutral spirit, this liqueur&amp;apos;s fresh black licorice flavor shines through|With its rich, deep flavor, Anisette makes a perfect addition to after-dinner cocktails|Update the classic Martini as a Black Anisette Martini, adding DeKuyper Blackberry and Vanilla with vodka, lime juice and muddled fresh blackberries, balancing sweetness with its distinctive flavor|DeKuyper has been the brand bartenders trust to add color, flavor and fun to any cocktail</F_1015895><F_1015703>60</F_1015703><F_1016615>New</F_1016615><F_1015702>30</F_1015702><F_1015701>1150</F_1015701><F_1015893>Prized in ancient times for medicinal properties, the aniseed in DeKuyper Anisette adds an exotic palate to traditional as well as modern cocktails. Distilled with imported aniseed and blended with fine neutral spirit, this liqueur&amp;apos;s fresh black licorice flavor shines through. With its rich, deep flavor, Anisette makes a perfect addition to after-dinner cocktails. Update the classic Martini as a Black Anisette Martini, adding DeKuyper Blackberry and Vanilla with vodka, lime juice and muddled fresh blackberries, balancing sweetness with its distinctive flavor. With a heritage dating back more than 300 years, DeKuyper Cordials &amp;amp; Liqueurs continues to be on the cutting edge of the spirits industry. DeKuyper&amp;apos;s evolution has been successful through the combination of its rich, traditional expertise with modern innovation, creating mixable and versatile cordials, liqueurs, crèmes, brandies and schnapps made from the world&amp;apos;s finest ingredients. DeKuyper has been the brand bartenders trust to add color, flavor and fun to any cocktail.</F_1015893><F_999>000</F_999></Item>';
