SET @ATTR_DATA = '<Item><F_1015700>FODMLBI</F_1015700><F_1015896>US</F_1015896><F_1015895>Add a refreshing twist to your favorite cocktails with the fresh taste of melons|With a subtle but recognizable sweetness, this liqueur pairs well with rum, tequila, or vodka|Pour it with Pucker® Sour Apple Schnapps and sour mix over ice for a sweet and sour Newton&amp;apos;s Cocktail, perfect for a hot summer day|DeKuyper has been the brand bartenders trust to add color, flavor and fun to any cocktail</F_1015895><F_1015703>46</F_1015703><F_1016615>New</F_1016615><F_1015702>23</F_1015702><F_1015701>693</F_1015701><F_1015893>Energize your cocktails with DeKuyper Melon Schnapps Liqueur. Add a refreshing twist to your favorite cocktails with the fresh taste of melons. With a subtle but recognizable sweetness, this liqueur pairs well with rum, tequila or vodka. Pour it with Pucker Sour Apple Schnapps and sour mix over ice for a sweet and sour Newton&amp;apos;s Cocktail, perfect for a hot summer day. With a heritage dating back more than 300 years, DeKuyper Cordials &amp;amp; Liqueurs continues to be on the cutting edge of the spirits industry. DeKuyper&amp;apos;s evolution has been successful through the combination of its rich, traditional expertise and modern innovation, creating mixable and versatile cordials, liqueurs, crèmes, brandies and schnapps made from the world&amp;apos;s finest ingredients. DeKuyper has been the brand bartenders trust to add color, flavor and fun to any cocktail.</F_1015893><F_999>000</F_999></Item>';
