,ATTR_DATA = '<Item><F_1015700>FOPCHAW</F_1015700><F_1015896>US</F_1015896><F_1015895>A sweet and sour cherry bomb, this liqueur brings bold flavor to your favorite cocktails|With its rich cherry flavor and bright red color, this Pucker brings classic sweetness to sophisticated Manhattans or simple cola|Blend it with rum and piña colada mix for a cool pink cocktail, or enjoy it in a Nuts and Cherries, balanced with DeKuyper Amaretto|DeKuyper has been the brand bartenders trust to add color, flavor and fun to any cocktail</F_1015895><F_1015703>30</F_1015703><F_1016615>New</F_1016615><F_1015702>15</F_1015702><F_1015701>750</F_1015701><F_1015893>Brighten any beverage with the flavor of DeKuyper Pucker Cherry Schnapps Liqueur. A sweet and sour cherry bomb, this liqueur brings bold flavor to your favorite cocktails. With its rich cherry flavor and bright red color, this Pucker® brings classic sweetness to sophisticated Manhattans or simple cola. Blend it with rum and piña colada mix for a cool pink cocktail or enjoy it in a Nuts and Cherries, balanced with DeKuyper Amaretto. With a heritage dating back more than 300 years, DeKuyper Cordials &amp;amp; Liqueurs continues to be on the cutting edge of the spirits industry. DeKuyper&amp;apos;s evolution has been successful through the combination of its rich, traditional expertise and modern innovation, creating mixable and versatile cordials, liqueurs, crèmes, brandies and schnapps made from the world&amp;apos;s finest ingredients.  DeKuyper has been the brand bartenders trust to add color, flavor and fun to any cocktail.</F_1015893><F_999>000</F_999></Item>'
