SET @ATTR_DATA = '<Item><F_1015700>FOPGRAW</F_1015700><F_1015896>US</F_1015896><F_1015895>Tart, purple, and delicious, this liqueur puts flavor and fun into all your drinks|With its intense grape taste, it makes a mouth-watering, colorful flavor shot with a tangy finish|Mix it up with Pucker Cherry and Sour Apple Schnapps and a splash of orange juice, poured over ice for a Fruit Juice Slammer, refreshing and sweet any time of year|DeKuyper has been the brand bartenders trust to add color, flavor and fun to any cocktail</F_1015895><F_1015703>30</F_1015703><F_1016615>New</F_1016615><F_1015702>15</F_1015702><F_1015701>753</F_1015701><F_1015893>Tart and sweet, DeKuyper Pucker Grape Schnapps Liqueur adds a fruit-flavored kick to your favorite drinks. Tart, purple and delicious, this liqueur puts flavor and fun into all your drinks. With its intense grape taste, it makes a mouth-watering, colorful flavor shot with a tangy finish. Mix it up with Pucker® Cherry and Sour Apple Schnapps and a splash of orange juice, pour over ice for a Fruit Juice Slammer, refreshing and sweet any time of year. With a heritage dating back more than 300 years, DeKuyper Cordials &amp;amp; Liqueurs continues to be on the cutting edge of the spirits industry. DeKuyper&amp;apos;s evolution has been successful through the combination of its rich, traditional expertise and modern innovation, creating mixable and versatile cordials, liqueurs, crèmes, brandies, and schnapps made from the world&amp;apos;s finest ingredients. DeKuyper has been the brand bartenders trust to add color, flavor and fun to any cocktail.</F_1015893><F_999>000</F_999></Item>';
